    "breadcrumb": "Home \u003e 3D Printers \u003e Prusa Mark 4",
    "content": "Once you have set up your print how you want it, press the slice button in the bottom right\ninsert picture\nOnce you do this, you will se a new tab appear, Preview. This allows you to look at the exact printing path of the printer.\ninsert image\nHere you can use the slider on the right to move up and down the layers, showing each layer path individually, and then use the bottom slider to watch the exact movement path for that layer.\nAdding breaks You can add breaks, custom g-code, and filament swaps into your print from here, by sliding the slider on the right to where you want and either clicking the (icon) icon to add a color swap, or right clicking to choose between pause, custom g-code, and color swaps.\nimage\nPauses will stop the print and let you either add parts into the print or check the print, and resume when you press a button on the printer. Add custom g-code will have the printer run a set custom g-code file. Color swap will do the same as regular clicking.\nIf you choose to do a filament swap, make sure you are using the same type of filament.\nView Settings You can also see specific parts of the print broken down by type of print and shaded different colors, as well as a menu of options at the bottom. This lets you view mroe specific information about the print.\nImage\nOnce you have done this, move to the transferring files section",
    "description": "Once you have set up your print how you want it, press the slice button in the bottom right\ninsert picture\nOnce you do this, you will se a new tab appear, Preview. This allows you to look at the exact printing path of the printer.\ninsert image\nHere you can use the slider on the right to move up and down the layers, showing each layer path individually, and then use the bottom slider to watch the exact movement path for that layer.",
