    "content": " Once you are ready to print, hit the Upload Print button and a menu will appear. This is the same menu that will appear when you use the One-Click Print feature.\nImage\nIn this menu you can either press Add to Queue or Print Now.\nAdd to Queue adds it to the list of prints availible on the printer.\nPrint Now starts the job immedietely. Your object should print shortly.\nOnce the print has finished, go to the removing print section.",
    "description": "Once you are ready to print, hit the Upload Print button and a menu will appear. This is the same menu that will appear when you use the One-Click Print feature.\nImage\nIn this menu you can either press Add to Queue or Print Now.\nAdd to Queue adds it to the list of prints availible on the printer.\nPrint Now starts the job immedietely. Your object should print shortly.",
