    "breadcrumb": "Home \u003e 3D Printers \u003e Ultimaker",
    "content": " Once you plug the USB into the printer, you should be greeted with this image\nimage\nTo print, hit the Print from USB button, then scroll untill you see the file you wish to print. Press the file name and another menu will appear.\nimage\nCheck that the time, and two filament types match what you expect, and then press start print. Your file should then print! If the filament types do not match what is in the printer, go to the Changing Filament Section. If any other issues arise go to the Troubleshooting section.",
    "description": "Once you plug the USB into the printer, you should be greeted with this image\nimage\nTo print, hit the Print from USB button, then scroll untill you see the file you wish to print. Press the file name and another menu will appear.\nimage\nCheck that the time, and two filament types match what you expect, and then press start print. Your file should then print! If the filament types do not match what is in the printer, go to the Changing Filament Section.",
