    "breadcrumb": "Home \u003e Laser Cutter",
    "content": " Cutter selection Before cutting make sure you have the right cutter selected by clicking the name of the glowforge in the top right and selecting which machine you are using\nImage\nThe “Glowforge” has the slot in the front for passthrough cutting while the “Glowforge II” does not.\nLast rearrangment Once you are ready to print, look at the material image on the workspace and make sure that the object is in the right location.\nImage\nThe two things to look out for are:\nMake sure your object is not over any holes in your material. image\nIf possible, try to move your object to leave the biggest space possible for others to cut. image\nPrinting When you are ready to print, click the Print button in the top right\nImage\nFrom there the printer will begin the printing process, and eventually show a menu.\nImage\nWhen this menu shows, check once again that your object is not over any holes as the bed image often shifts slightly when you do this.\nOnce you are confident it will print correctly, move to the laser cutter and hit the flashing white button. Your design should begin printing.\nIf you need to cancel at any time, just hit the cancel print button on the computer.",
    "description": "Cutter selection Before cutting make sure you have the right cutter selected by clicking the name of the glowforge in the top right and selecting which machine you are using\nImage\nThe “Glowforge” has the slot in the front for passthrough cutting while the “Glowforge II” does not.\nLast rearrangment Once you are ready to print, look at the material image on the workspace and make sure that the object is in the right location.",
    "tags": [],
