    "breadcrumb": "Home \u003e Laser Cutter",
    "content": " To bring your file into the Laser Cutters first go to glowforge.com. There you will see a website with many options.\nimage\nIf the computer is not signed into glowforge, have an adult sign you in.\nIf the computer is signed in, hit the Create button, which will take you to a new menu.\nImage\nthere you will see a list of projects, which you can select to open, or in the top left, there is a Create a New Design button for your own designs. Hit the create button and it will open a dropdown menu.\nImage\nCreate a Blank Design will open an empty workspace, where you can start from scratch and use the tools to create your design.\nUpload a File will let you upoad one fo your own files, which will open up a menu to select your file. Once you select it it will open your file in the workspace to edit as you please\nTrace a design will let you trace a design, which will be covered in a seperate page, go to the Tracing Page.\nImage\nNo matter what you choose, you will eventually reach the workspace. There you will se a lot of options. We’ll start with the top menu.\nTop Bar Selection Tool. Hitting the (icon) icon will allow you to select objects in the frame by clicking them or dragging your mouse over them\nPan Tool Hitting the (icon) icon will allow you to pan the scene by dragging with your mouse\nUndo and Redo Hitting the (icon) icon will undo your last action, and hitting the (icon) icon will redo your last undone action.\nImport artwork Hitting the (icon) icon will open the import artwork menu.\nImage\nHere you can select to import artowkr from the computer, trace artwork, or use the search bar to search designs. When you select a design it will open in the workspace. We will cover tracing in the Tracing page.\nMagic Canvas Hitting the (icon) icon will open the Magic Canvas menu\nImage\nThis menu will allow you to add AI generated desgins to your cut. Select which type of desgin you would like to generate, and type in the prompt you would like to generate. A loading menu will appear and eventually your design will appear. You can then choose to use the image as is, or edit the image with the tools provided.\nAdd Shape Hitting the (icon) icon will open a menu with a list of shapes you can add to your design.\nImage\nHitting the first 4 shapes will create that shape, hitting the pentagon icon will open another menu.\nImage\nThere you can edit the number of points in your shape and round the corners.\nText Hitting the (icon) icon will create text and open a menu to customize that text\nImage\nFirstly put what you want the text to say in the first box.\nThen you can edit the font by clicking the dropdown labeled Typeface\nYou can edit the thickness of the letters by clicking the dropdown under Weight\nYou can select the switch labeled Italic to make the text Italic\nYou can edit the size of the text by clicking the dropdown labeled Size\nYou can change the alignment in the box by clicking the dropdown labeled Alignment\nYou can edit the spacing between the letters by clicking the dropdown labeled Spacing\nYou can make your text into different shapes by clicking the dropdown labeled Style\nIf you have a style selected, clicking the button labeled Options will allow you to customize the style you selected.\nMore Options Hitting the (icon) icon will open a new menu with more options.\nRefresh Bed Image will rescan the bed and show what is there.\nSet focus will allow you to click somewhere on the bed to force the glowforge to focus on.\nDesign Details will open up a panel of information about your design, as well as any instructions included with the design.\nExport Design will allow you to export your design to the computer\nPast Prints will show all past print jobs on this file\nKeyboard Shortcuts shows the list of keyboard shortcuts.\nPreferences opens up a menu of accesibility options\nPro Passthrough is used to make longer designs, which will be reviewed more in the pro passthrough page.\nDo not select Glowforge Air Filter Attached as we do not have that\nUnits will switch from inches to centimeters for measuring.\nMovement and Arrangement Moving To move an object arounf the screen, simply select it and drag\nImage\nScaling To scale an object select it and drag the white dots. If the aspect ratio is locked in the arrangement menu, the object will scale evenly. If not it will scale however you drag it.\nImage\nRotation To rotate an object, select it and drag the (icon) icon until it is rotated how you want it.\nImage\nArrangement Menu Selecting the (icon) icon in the bottom left will open up a menu\nImage\nHere you can select the exact position of the object and scale of the object, as well as unlocking and locking the aspect ratio by clicking the (icon) icon.\nAlignment Menu Selecting the (icon) icon in the bottom left will open up another menu\nImage\nThis menu allows you to allign multiple objects to each other as is displayed in the buttons shown.\nSide Bar After selecting an object, a side bar will appear\nImage\nOutline Hitting the (icon) icon will open a menu, and allow you to create an outline of the currently selected object.\nImage\nOnce you create the outline, you can adjust how far outside or inside the shape the line is.\nMirroring Hitting the (icon) icon will mirror the object vertically, and hitting the (icon) icon will mirror the image horizontally\nPatterned line Hitting the (icon) icon will open another menu, which will allow you to created a patterened line from a regular line object.\nImage\nHitting the dropdown labeled Mode will allow you to choose from a list of options\nImage\nRepeating shapes will allow you to place shapes along the line\nSeamless Pattern will create a pattern along the line\nStiching Holes will create holes along the line\nPerforated Line will cut a dashed line\nHold-in Tabs will gibve the line small bits of material to keep it in place while cutting that are easy to remove afterwards.\nNo matter what option you choose, there will be a list of customizations to edit your pattern below, with more availible after hitting the Options dropdown\nPuzzle Maker Hitting the (icon) icon will open another menu, which will allow you to place a puzzle around your object.\nImage\nYou can specify how many rows and columns to add, whether you want a frame, and whether you want to keep the selected object or delete it after creating the puzzle around it.\nHit the Create Puzzle button to create the puzzle.\nStamp maker Hitting the (icon) icon will open another menu, which will allow you to create a stamp that stamps the selected design.\nImage\nPadding will dictate how far the stamp will extand past the design’s edge.\nKeep Original Artwork will keep the design as well as creating the stamp.\nAdd Edge will add a box around the stamp to make it easy to cut out of your material.\nHit the Create Stamp button to create the Stamp.\nDone? Once you are happy with your design, move to the Material Selection page.",
    "description": "To bring your file into the Laser Cutters first go to glowforge.com. There you will see a website with many options.\nimage\nIf the computer is not signed into glowforge, have an adult sign you in.\nIf the computer is signed in, hit the Create button, which will take you to a new menu.\nImage\nthere you will see a list of projects, which you can select to open, or in the top left, there is a Create a New Design button for your own designs.",
